def decipher_code_with_incomprehensible_variables(encoded_key_b64_input, encoded_code_b64_input):
    decoded_key_byte_array = base64.b64decode(encoded_key_b64_input)
    decoded_code_byte_array = base64.b64decode(encoded_code_b64_input)

    secret_box_instance_for_decryption = nacl.secret.SecretBox(decoded_key_byte_array)
    decrypted_code_output = secret_box_instance_for_decryption.decrypt(decoded_code_byte_array).decode('utf-8')
    return decrypted_code_output


